import Vue from 'vue'
import Vuex from 'vuex'

Vue.use(Vuex)

export default new Vuex.Store({
  state: {
    articles : []
  },
  getters: {
    getArticles: (state) => state.articles
  },
  mutations: {
    // Please disregard
    SET_ARTICLES(state, articles) {
      state.articles = articles;
    },
  },
  actions: {
    async fetchArticles({ commit }) {
      try {
        const data = [{ test: 1 }]
        commit("SET_ARTICLES", data);
      } catch (error) {
        console.log(error);
      }
    },
  },
  modules: {
  }
})
